const showData = async (docType) => {
  switch (docType) {
    case "dl":
      overlay.value = true;
      identityDocName.value = "Driver's License";
      identityData.value = projectStore.getPassportAndDLData("USDriverLicense");
      break;
    case "ppt":
      overlay.value = true;
      identityDocName.value = "Passport";
      identityData.value = projectStore.getPassportAndDLData("USPassport");
      break;
    case "ssn":
      overlay.value = true;
      identityDocName.value = "Social Security Number";
      identityData.value = projectStore.getSSNData();
      break;
    case "pv":
      const qrCodeDataUrl = await generateQRCode();
      // Generate HTML content
      const htmlContent = await generateEmailContent(qrCodeDataUrl);
      // Convert HTML to base64
      const base64Template = btoa(htmlContent);
      goSDK
        .sendEmail({
          userID: getUser.value.userId,
          emailTo: userEmail.value,
          smsTo: "",
          isdCode: "",
          SMSTemplateB64: "",
          emailTemplateB64: base64Template,
        })
        .then(() => {
          logoutDialog.value = true;
        });
      break;
  }
};
